func wbPropForRune(r rune) wbProp {
	if r < 256 {
		return wbAsciiLookupTbl[r]
	}

	i, j := 0, len(wbRanges)
	for i < j {
		mid := i + (j-i)/2
		rng := wbRanges[mid]
		if rng.Start <= r && r <= rng.End {
			return rng.Prop
		} else if r < rng.Start {
			j = mid
		} else {
			i = mid + 1
		}
	}
	return wbPropNone
}
